function run(project, entity, file, data) {
    // do not change anything in project, entity, file!

    data.phptype = field => {
        if (field.cast) {
            const found = project.PresetManager.find('CastPHP').PropertyManager.find(field.cast)
            if (found) {
                return found.value
            }
        }

        if (['created_at', 'updated_at', 'deleted_at'].indexOf(field.name) > -1) {
            return '\\Illuminate\\Support\\Carbon'
        }

        const found = project.PresetManager.find('FieldType').PropertyManager.find(field.type)
        if (found) {
            return found.tag
        }

        return 'mixed'
    }

    data.ruletext = field => {
        if (field.RuleManager.list.length) {
            const list = field.RuleManager.list.map(rule => {
                return rule.value ? `${rule.name}:${rule.value}` : rule.name
            })
            return `['${list.join("', '")}']`
        }
        return '[]'
    }

    data.hasTimeStamp = () => {
        const created_at = entity.FieldManager.list.find(field => field.name === 'created_at')
        if (created_at) {
            const updated_at = entity.FieldManager.list.find(field => field.name === 'updated_at')
            if (updated_at) {
                return true
            }
        }
        return false
    }
}

function run(project, entity, file, data) {
    // do not change anything in project, entity, file!

    data.model = entity.FileManager.findByLayer('Model')
    if (!data.model) throw new Error('Model is missing!')

    data.seedtext = seed => {
        const list = ['$faker']
        if (seed.unique) {
            list.push('unique()')
        }

        if (seed.type === 'property') {
            list.push(seed.property)
            return list.join('->')
        }

        if (seed.type === 'method') {
            list.push(`${seed.method}(${seed.parameter})`)
            return list.join('->')
        }

        return seed.raw
    }
}

function run(project, entity, file, data) {
    // do not change anything in project, entity, file!

    data.fieldtext = field => {
        const list = ['$table']

        if (field.length) {
            list.push(`${field.type}('${field.name}', ${field.length})`)
        } else {
            list.push(`${field.type}('${field.name}')`)
        }

        if (field.collation) {
            list.push(`collation(${field.collation})`)
        }

        if (field.comment) {
            list.push(`comment(${field.comment})`)
        }

        if (field.value) {
            list.push(`default(${field.value})`)
        }

        if (field.allowNull) {
            list.push('nullable()')
        }

        if (field.useCurrent) {
            list.push('useCurrent()')
        }

        if (field.unsigned) {
            list.push('unsigned()')
        }

        return list.join('->')
    }
}

function run(entity, project) {
    const FieldTypeInteger = project.PresetManager.find('FieldTypeInteger').PropertyManager
    const FieldTypeNumeric = project.PresetManager.find('FieldTypeNumeric').PropertyManager

    const addField = function (field, name, isBoolean = true) {
        const found = field.RuleManager.find(name)
        if (found) {
            return found
        }
        const rule = field.RuleManager.make(name, isBoolean)
        field.RuleManager.add(rule)
        return rule
    }

    const setUnique = function (entity) {
        entity.IndexManager.uniqueIndexList.forEach(index => {
            if (index.FieldManager.list.length === 1) {
                const field = index.FieldManager.list[0]
                const found = entity.FieldManager.find(field.name)
                if (found) {
                    const rule = addField(found, 'unique', false)
                    rule.value = entity.tableName
                }
            }
        })
    }
    setUnique(entity)

    const setRule = function (field, IntegerManager, NumericManager) {
        if (field.included) {
            // go on
        } else {
            return
        }

        if (field.isIncrement) {
            return
        }

        addField(field, 'required')

        if (field.type === 'boolean') {
            addField(field, 'boolean')
            return
        }
        if (IntegerManager.find(field.type)) {
            addField(field, 'integer')
            return
        }
        if (NumericManager.find(field.type)) {
            addField(field, 'numeric')
            return
        }
        if (field.type === 'char' || field.type === 'string') {
            if (field.length) {
                const max = addField(field, 'max', false)
                max.value = field.length
            }
        }
    }
    entity.FieldManager.list.forEach(field => setRule(field, FieldTypeInteger, FieldTypeNumeric))
}
